var fragmentsOwned;

(function() {
 var fragmentsOwnedElement = document.getElementById("fragmentsOwned");
 if (fragmentsOwnedElement) {
  var fragmentsOwnedString = fragmentsOwnedElement.innerText;
  fragmentsOwned = parseFloat(fragmentsOwnedString);
  if (fragmentsOwnedString.length > 2 && fragmentsOwnedString.substring(fragmentsOwnedString.length - 2) == "Dd") {
   fragmentsOwned *= 1000;
  }
  if (fragmentsOwnedString.length > 2 && fragmentsOwnedString.substring(fragmentsOwnedString.length - 2) == "Td") {
   fragmentsOwned *= 1000 * 1000;
  }
  if (fragmentsOwnedString.length > 3 && fragmentsOwnedString.substring(fragmentsOwnedString.length - 3) == "Qad") {
   fragmentsOwned *= 1000 * 1000 * 1000;
  }
  
  var extraZones = 0;
  if (fragmentsOwned >= 26600 * 1000) {
   extraZones = 10;
  } else if (fragmentsOwned >= 7030 * 1000) {
   extraZones = 9;
  } else if (fragmentsOwned >= 1870 * 1000) {
   extraZones = 8;
  } else if (fragmentsOwned >= 494 * 1000) {
   extraZones = 7;
  } else if (fragmentsOwned >= 131 * 1000) {
   extraZones = 6;
  } else {
   return;
  }

  if (extraZones > 0)   {
	document.getElementById("lootAdvMapsRange").value = 0;
	document.getElementById("sizeAdvMapsRange").value = 0;
	document.getElementById("difficultyAdvMapsRange").value = 0;
	document.getElementById("biomeAdvMapsSelect").value = "Random";
	document.getElementById("advSpecialSelect").value = "Random";
	document.getElementById("advExtraLevelSelect").value = extraZones;
	updateMapNumbers();
	updateMapCost();
  }
  
 }

})();

